const Header = () => {
  return (
    <>
      <header>
        <h1>
          ToDo App
        </h1>
        <nav className="menu">
          <ul>
            <li><a href="/">To Do</a></li>
            <li><a href="/">Done</a></li>
            <li><a href="/">Account</a></li>
          </ul>
        </nav>
        <img src="/images/menu-icon.svg" alt="menu-icon" />
      </header>
      <style jsx>
        {`
        header {
          max-width: 100%;
          height: 60px;
          background: #64D7EB;
          color: white;
          display: flex;
          justify-content: space-evenly;
          align-items: center;
          box-shadow: 7px 0px 10px rgba(0, 0, 0, 0.1);
        }

        h1 {
          font-size: 36px;
        }
        ul {
          display: none;
        }
        li {
          margin-right: 10px;
          list-style: none;
          &{

          }
        }
        @media screen and (min-width: 425px){
          header {
            justify-content: space-between;
            padding: 0 40px;
          }
          img {
            display: none
          }
          ul {
            display: flex;
          }
        } 

      `}
      </style>
    </>
  );
};

export default Header;
